import * as d3 from "d3";

function try01(){
    var data = [
        { day: "星期一", percentage: 100, sleep: 30.0, lesson: 34.3, play_games: 5, learn:15, sports: 4.0, others: 11.7 },
        { day: "星期二", percentage: 100, sleep: 29.0, lesson: 37.5, play_games: 5, learn:13.9, sports: 4.0, others: 10.6 },
        { day: "星期三", percentage: 100, sleep: 32.0, lesson: 18.8, play_games: 10, learn:21.5, sports: 4.8, others: 12.9 },
        { day: "星期四", percentage: 100, sleep: 32.0, lesson: 18.8, play_games: 10, learn:21.7, sports: 5.4, others: 12.1 },
        { day: "星期五", percentage: 100, sleep: 32.0, lesson: 12.5, play_games: 12.5, learn:17.4, sports: 11.8, others: 13.8 },
        { day: "星期六", percentage: 100, sleep: 35.0, lesson: 0, play_games: 25.0, learn:17.1, sports: 8.2, others: 14.7 },
        { day: "星期日", percentage: 100, sleep: 32.0, lesson: 12.5, play_games: 25.0, learn:12.4, sports: 3.6, others: 14.5 },
    ];
    for(var i=0; i<7; i++){
        data[i].sleep_up = data[i].sleep;
        data[i].lesson_up = data[i].lesson;
        data[i].play_games_up = data[i].play_games;
        data[i].learn_up = data[i].learn;
        data[i].sports_up = data[i].sports;
        data[i].others_up = data[i].others;
    }
    for(var i=0; i<7; i++){
        if(data[i].lesson < data[i].sleep) {data[i].sleep_up += data[i].lesson;}
        if(data[i].play_games < data[i].sleep) {data[i].sleep_up += data[i].play_games;}
        if(data[i].learn < data[i].sleep) {data[i].sleep_up += data[i].learn;}
        if(data[i].sports < data[i].sleep) {data[i].sleep_up += data[i].sports;}
        if(data[i].others < data[i].sleep) {data[i].sleep_up += data[i].others;}

        if(data[i].sleep < data[i].lesson) {data[i].lesson_up += data[i].sleep;}
        if(data[i].play_games < data[i].lesson) {data[i].lesson_up += data[i].play_games;}
        if(data[i].learn < data[i].lesson) {data[i].lesson_up += data[i].learn;}
        if(data[i].sports < data[i].lesson) {data[i].lesson_up += data[i].sports;}
        if(data[i].others < data[i].lesson) {data[i].lesson_up += data[i].others;}

        if(data[i].lesson < data[i].play_games) {data[i].play_games_up += data[i].lesson;}
        if(data[i].sleep < data[i].play_games) {data[i].play_games_up += data[i].sleep;}
        if(data[i].learn < data[i].play_games) {data[i].play_games_up += data[i].learn;}
        if(data[i].sports < data[i].play_games) {data[i].play_games_up += data[i].sports;}
        if(data[i].others < data[i].play_games) {data[i].play_games_up += data[i].others;}

        if(data[i].lesson < data[i].learn) {data[i].learn_up += data[i].lesson;}
        if(data[i].play_games < data[i].learn) {data[i].learn_up += data[i].play_games;}
        if(data[i].sleep < data[i].learn) {data[i].learn_up += data[i].sleep;}
        if(data[i].sports < data[i].learn) {data[i].learn_up += data[i].sports;}
        if(data[i].others < data[i].learn) {data[i].learn_up += data[i].others;}

        if(data[i].lesson < data[i].sports) {data[i].sports_up += data[i].lesson;}
        if(data[i].play_games < data[i].sports) {data[i].sports_up += data[i].play_games;}
        if(data[i].learn < data[i].sports) {data[i].sports_up += data[i].learn;}
        if(data[i].sleep < data[i].sports) {data[i].sports_up += data[i].sleep;}
        if(data[i].others < data[i].sports) {data[i].sports_up += data[i].others;}

        if(data[i].lesson < data[i].others) {data[i].others_up += data[i].lesson;}
        if(data[i].play_games < data[i].others) {data[i].others_up += data[i].play_games;}
