    // 设置SVG的宽度和高度
    var width = 700;
    var height = 400;
    var margin = { top: 20, right: 20, bottom: 40, left: 40 };
    var innerHeight = height - margin.top - margin.bottom;

    // 创建SVG元素
    var svg = d3.select("body").append("svg")
        .attr("width", width)
        .attr("height", height);

    var g = svg.append("g")
        .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

    // 创建比例尺，映射星期到X轴上的位置
    var xScale = d3.scaleBand()
        .domain(data.map(d => d.day))
        .range([0, width])
        .padding(0.6);

    // 创建比例尺，映射百分比到Y轴上的位置
    var yScale = d3.scaleLinear()
        .domain([0, d3.max(data, d => d.percentage)])
        .range([innerHeight, 0]);

    // 创建生成器
    var xAxis = d3.axisBottom(xScale);
    var yAxis = d3.axisLeft(yScale);

    // 在SVG中添加X轴
    g.append("g")
        .attr("lesson", "x-axis")
        .attr("transform", "translate(-38," + (innerHeight - 10) + ")")
        .call(xAxis);
    // 在SVG中添加Y轴
    g.append("g")
        .attr("lesson", "y-axis")
        .attr("transform", "translate(11,-18)")
